import React from "react";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";


const Header = () => {

  const [flavors, setFlavors] = React.useState([]);

    React.useEffect( () => {
        fetchData();
    }, []);


    const fetchData = async () => {
        const response = await fetch("http://localhost:5000");
        const items = await response.json();

        setFlavors(items);
        console.log(flavors);
    };



    return (
      <div className="header">
        <Navbar className="navbar" expand="lg">
          <Container className="container mt-3 mb-3">
            <Navbar.Brand className="navbar-brand" href="/">
              React-Bootstrap
            </Navbar.Brand>
            <Navbar.Toggle className="navbar-toggle" aria-controls="basic-navbar-nav" />
            <Navbar.Collapse className="navbar-collapse" id="basic-navbar-nav">
              <Nav className="nav ms-auto">
                <Nav.Link className="nav-link" href="/home">Home</Nav.Link>
                <Nav.Link className="nav-link" href="/link">Link</Nav.Link>
                <NavDropdown class="navdropdown" title="About" id="basic-nav-dropdown">
                  <NavDropdown.Item class="navdropdown-item" href="/story">Our Story</NavDropdown.Item>
                  <NavDropdown.Item class="navdropdown-item" href="/contact">Contact</NavDropdown.Item>
                </NavDropdown>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
      </div>
    );
};


export default Header;
